import { useState } from 'react';

function Index() {
    const [counter, setCounter] = useState(0);

    const decrement = () => {
        setCounter(i => (i-1));
    }

    const increment = () => {
        setCounter(i => (i+1))
    }

    return (
       <>
       <button onClick={()=>{decrement()}}>-</button>
       <h2>{counter}</h2>
       <button onClick={()=>{increment()}}>+</button>
       </>
    )
}

export default Index;
